body.script:
window.onload = function() {
  var redirectUrl = 'https:\x2F\x2Fwww.google.com\x2Faccounts\x2FAccountChooser?hd=bbejaguars.org\x26continue=https%3A%2F%2Fsites.google.com%2Fa%2Fbbejaguars.org%2Fsites%2Fsystem%2Ferrors%2FProxiedWebspaceNotFound%3Fhost%3Dwww.bbe.k12.mn.us%26webspace%3Dbelgrade-brooten-elrosa-public-schools\x26followup=https%3A%2F%2Fsites.google.com%2Fa%2Fbbejaguars.org%2Fsites%2Fsystem%2Ferrors%2FProxiedWebspaceNotFound%3Fhost%3Dwww.bbe.k12.mn.us%26webspace%3Dbelgrade-brooten-elrosa-public-schools\x26service=jotspot\x26ul=1';
  var domain = 'bbejaguars.org';
  var hash = window.location.hash;
  if (hash) {
  var match = hash.match(/[#&]Email=([^&]+)/);
  if (match) {
  redirectUrl += "&Email=" + match[1] + "@" + domain;
  }
  }
  window.location.replace(redirectUrl);
};
